:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Caroline Elizabeth and LUDBROOK, Samuel Blomfield
  JLUDBROOK , Henry Samuel (Harry) and KINSELLA, Hana
  JLUDBROOK, Geoffrey Valentine and WHIBLEY, Lucy
  JLUDBROOK, Diana Robin and PARKER, Anthony Gordon Hastie (Tony)
  01> LUDBROOK, Richard Hastie Parker
  b 06.10.1960
  Richard changed his surname from Parker to Ludbrook by deed poll in 1990. Address: Level 4,
  Pioneer House, 134 Broadway, NSW, Australia.
  Richard was educated at Hereworth School, Wanganui Collegiate School and Auckland University (BA,
  BCom). He travelled extensively both before and after university, including spending a year in
  Tokyo teaching English. He then settled in Sydney where he worked as a management consultant for a
  year during the 1980s, and dabbled in film-making before becoming a commercial photographer. He
  worked extensively for Vogue and similar magazines and for the major advertising agencies. In 1994
  he started a business hiring equipment and studios to other photographers and their clients and
  this has grown rapidly to become the largest photographic studio complex in Australia. Richard
  plays tennis and squash, is a keen skier and still travels overseas every year.
  02> PARKER, Geoffrey Kent m on 25.11.1989 to ROBERTSON, Angela Grace
  b 05.11.1961
  b 26.12.1960
  Kent b. at Hastings and m. at Waimarama, Hawkes Bay. Separated 1998. Grace, d/o Ewing Robertson
  and Nancy Robertson, b. at Warkworth. Address: 42 Te Mata Road, Havelock North.
  Kent was educated at Hereworth School and Wanganui Collegiate School and has a BA in Psychology
  from Massey University and a full-year computing certificate from Polytechnic. He has spent many
  years working on the family property at Paki Paki as well as three years in the hospitality
  industry, working at management level. He has also spent three years in educational administration
  and a year as a computer tutor. He is currently working on an educational programme to take to
  secondary schools.
  b1> PARKER, Lydia Lucy
  b 19.04.1990
  Lydia b. at Hastings.
  02> PARKER, Madeleine Rose
  b 29.09.1993
  03> PARKER, John Ludbrook
  b 21.06.1966
  Address: "Wairunga", RD 12, Havelock North.
  John was educated at Huntley School, Wanganui College School and Massey University (BAg). After a
  period of overseas travel in the 1980s he is now farming on "Wairunga". In 1997 John and his
  father built a nine-hole golf course on the farm and, with his sister Diana, a summer golf course
  and cafe is currently operated there from Easter to Labour Weekend. In 1998 accommodation became
  available in farm cottages. John is keen on native trees and is planting to enhance the golf
  course, whilst still farming sheep and cattle at Wairunga. He enjoys tennis, cricket, golf and
  skiing.
  04> PARKER, Diana Elizabeth
  b 18.09.1968
  Address: PO Box 8484, Havelock North.
  Diana was educated at Woodford House and Victoria University, graduating BA in History. She has
  travelled extensively, mainly in the United States, Central America and the East, including India.
  She is an enthusiastic skier and conservationist, and her cooking skills are an asset to the
  Wairunga Golf Course and cafe which she runs with her brother and family.
